import React from 'react';
import { Link } from "react-router-dom";
import logo from "../images/logo.svg";
import hamburgerIcon from "../images/icons/hamburger.svg";

function Nav({ mobileSm, mobileLg, tabletSm, tabletLg, desktopSm, desktopLg }) {

  return (	
    <nav className="nav row spaced container">
    	<img
    	src={logo}
			alt="logo" />

    	{ mobileSm || mobileLg ?

    	<img
    	src={hamburgerIcon}
    	alt="menu" />

  		:
    	<ul className="row">

    		<Link 
    		className="nav__item" 
    		to="/">
    			<li>HOME</li>
    		</Link>

    		<Link 
    		className="nav__item" 
    		to="/portfolio">
    			<li>PORTFOLIO</li>
    		</Link>

    		<Link 
    		className="nav__item" 
    		to="/contact">
    			<li>CONTACT ME</li>
    		</Link>

    	</ul> 
    	}

    	<div className="mobile-menu">
    	</div>

    </nav>
  );
}

export default Nav;
